// File: contracts/Otherworlds.sol

pragma solidity ^0.8.4;



contract Otherworlds is ERC721, Ownable {
    uint256 public mintPrice;
    uint256 public totalSupply;
    uint256 public maxSupply;
    uint256 public maxPerWallet;
    uint256 public maxAllowedPerWallet;
    bool public isPublicMintEnabled;
    bool public isAllowListMintEnabled;
    string internal baseTokenUri;
    string public hiddenMetadataUri;
    address public withdrawWallet;
    mapping(address => uint256) public WalletMints;
    mapping(address => uint256) public AllowList;

    bool public isRevealed;
    string public WRLDS_PROVENANCE;

    constructor() payable ERC721('Otherworlds', 'WRLDS') {
        mintPrice = 0.15 ether; 
        totalSupply = 0;
        maxSupply = 100;
        maxPerWallet = 2;
        maxAllowedPerWallet = 1;
        withdrawWallet = 0xc9aD265650816C6590b19219f27089366f2Cc306;
        setHiddenMetadataUri("ipfs://QmQcqfK4Luw5zNPR372aaFZ2pMHKt1qrem7DtWUrL8Vkov/"); 
        isRevealed = false;
        WRLDS_PROVENANCE = "7a6c2121c04f3411a3268413a75e4e305d0ec5e65e304538da38f0ae6d5c52c5";

    }

    modifier callerIsAWallet() {
        require(tx.origin ==msg.sender, "Another contract detected");
        _;
    }

    function setIsPublicMintEnabled(bool isPublicMintEnabled_) external onlyOwner {
        isPublicMintEnabled = isPublicMintEnabled_;
    }

    function setIsAllowListMintEnabled(bool isAllowListMintEnabled_) external onlyOwner {
        isAllowListMintEnabled = isAllowListMintEnabled_;
    }

    function addToAllowlist(address[] memory addresses) external onlyOwner {
        for (uint256 i = 0; i < addresses.length; i++) {
            AllowList[addresses[i]] = maxAllowedPerWallet;
        }
    }


    function reveal() external onlyOwner {
        isRevealed = true;
    }

    function setHiddenMetadataUri(string memory hiddenMetadataUri_) public onlyOwner {
        hiddenMetadataUri = hiddenMetadataUri_;
    }

    function setBaseTokenUri(string calldata baseTokenUri_) external onlyOwner {
        baseTokenUri = baseTokenUri_;
    }

    function tokenURI(uint256 tokenId_) public view override returns (string memory) {

        if (isRevealed == false) {
            return hiddenMetadataUri;
            }

        require(_exists(tokenId_), 'Token does not exist!');
        return string(abi.encodePacked(baseTokenUri, Strings.toString(tokenId_), ".json"));
    }

    string private customContractURI = "ipfs://QmPkhGhoNk4KYGsn5Qs8gVGebhqcCjQKZKx1oVfhs83qfg/";

    function setContractURI(string memory customContractURI_) external onlyOwner {
        customContractURI = customContractURI_;
    }

    function contractURI() public view returns (string memory) {
        return customContractURI;
    }

    function withdraw() external onlyOwner {
        (bool success, ) = withdrawWallet.call{ value: address(this).balance }('');
        require(success, 'withdraw failed');
    }

    function mint(uint256 quantity_) public payable callerIsAWallet {
        require(isPublicMintEnabled, 'minting not enabled');
        require(msg.value >= quantity_ * mintPrice, 'wrong mint value');
        require(totalSupply + quantity_ <= maxSupply, 'sold out');
        require(WalletMints[msg.sender] + quantity_ <= maxPerWallet, 'exceed max wallet');

        for(uint256 i = 0; i < quantity_; i++) {
            uint256 newTokenId = totalSupply + 1;
            WalletMints[msg.sender]++;
            totalSupply++;
            _safeMint(msg.sender, newTokenId);
        }
    }

    function allowListMint() public payable callerIsAWallet {
        require(isAllowListMintEnabled, 'allow list minting not enabled');
        require(msg.value >= maxAllowedPerWallet * mintPrice, 'wrong mint value');
        require(totalSupply + maxAllowedPerWallet <= maxSupply, 'sold out');
        require(AllowList[msg.sender] > 0, "not eligible for allowlist mint");
        require(WalletMints[msg.sender] + maxAllowedPerWallet <= maxPerWallet, 'exceed max wallet');

        AllowList[msg.sender]--;
        uint256 newTokenId = totalSupply + 1;
        WalletMints[msg.sender]++;
        totalSupply++;
        
        _safeMint(msg.sender, newTokenId);
    }

    function devMint() external onlyOwner{
        uint256 numOfDevMints = 4;
        require(totalSupply + numOfDevMints <= maxSupply, 'sold out');

        for(uint256 i = 0; i < numOfDevMints; i++) {
            uint256 newTokenId = totalSupply + 1;
            WalletMints[msg.sender]++;
            totalSupply++;
            _safeMint(msg.sender, newTokenId);
        }
    }  
}
